import React, { useState } from 'react';
import styled from 'styled-components';

const CSSOutputWrapper = styled.div`
  min-height: 400px;
  min-width: 400px;
  border: 1px solid white;
`;

const CssOutput = () => {
  return <CSSOutputWrapper />;
};

export default CssOutput;
